import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom'; // Added Redirect here
import Login from './components/Login';
import Signup from './components/Signup';
import ExpenseList from './components/ExpenseList';
import AddExpense from './components/AddExpense';
import PrivateRoute from './PrivateRoute';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/login" component={Login} />
        <Route path="/signup" component={Signup} />
        <PrivateRoute path="/expenses" component={ExpenseList} />
        <PrivateRoute path="/add-expense" component={AddExpense} />
        <Redirect from="/" to="/expenses" /> {/* Ensures users are redirected to /expenses by default */}
      </Switch>
    </Router>
  );
};

export default App;
